		char[] cc_next = cc_parser.next;
		char[] cc_check = cc_parser.check;
		char[] cc_base = cc_parser.base;
		char[] cc_default = cc_parser.defaults;
		char[] cc_meta = cc_parser.meta;
		char[] cc_gotoDefault = cc_parser.gotoDefault;
